import { Link } from "react-router-dom";
import './menu.scss';
import ShoppingBasket from '../shoppingBasket/shoppingBasket.js';
const { Provider, Consumer } = React.createContext();
import ShoppingBasketConsumer from '../shoppingBasketConsumer/shoppingBasketConsumer.js'

const NumberContext = React.createContext();

export default class Menu extends PureComponent {
  render() {
    return (
      <div className="head">
        <nav>
          <Link to="/">Главная</Link>
          <Link to="/aboutus">О нас</Link>
        </nav>
        {/* <NumberContext.Provider value="5"> */}
        <ShoppingBasketConsumer.Consumer>
        {value => <h2>{value}</h2>}
        </ShoppingBasketConsumer.Consumer>
        {/* </NumberContext.Provider> */}
      </div>
    )
  }
}
